SECTION 4.3

3.	QUALITY

3.1	The gas to be received by COMPANY for SHIPPER'S account must upon delivery by SHIPPER to COMPANY:

(a)	be free of objectionable liquids and solids and be commercially free from dust, gums, gum-forming constituents, or other liquid or solid matter which might become separated from the gas in the course of transportation through the pipeline or which could cause inaccurate measurement;

(b)	not contain more than 200 grains of total sulphur or 3 grains of hydrogen sulphide per Mcf;

(c)	not contain more than 2% by volume of carbon dioxide, 3% of nitrogen, and 0.25% of oxygen nor more than a combined total of inert gases of 4% by volume;

(d)	not contain more than 1.5% by volume of butane and higher (C4+) hydrocarbons;

       (e)	not contain more than 7 pounds of water per 1,000 Mcf;

(f)	have a temperature of not more than 120 degrees Fahrenheit, nor less than the greater of 35 degrees Fahrenheit or 5 degrees Fahrenheit above the hydrocarbon dew point ("HDP") temperature of the gas; and

(g)	have a Wobbe number of at least 1,300 and no more than 1,400 Btu per cubic foot of dry gas. The Wobbe number of the gas shall be determined by dividing the gross heating value of the gas by the square root of the specific gravity of the gas. The gross heating value of the gas shall be determined by a mutually acceptable test of one cubic foot of gas at a temperature of sixty degrees Fahrenheit and at a pressure of fourteen and seventy-three hundredths (14.73) pounds per square inch absolute.  Tests and calculations for such determination of composition, heating value, specific gravity, and Wobbe number shall be conducted for each Receipt Point as frequently as possible using the equipment installed at each Receipt Point. 

3.2	The gas redelivered hereunder will meet the specifications set forth in Section 3.1 above, except with respect to (a) odorant, which shall be governed by Section 8.4 of these GT&C, and (b) the minimum temperature set forth in Section 3.1(f) above for any measurement stations at which COMPANY does not maintain heaters.

3.3	Unless otherwise specified herein, SHIPPER'S compliance with the standards in this Section 3 shall be determined by the most appropriate among approved standard methods generally in use in the natural gas industry, as selected by COMPANY in its reasonable judgment.

3.4	(a)	Should any gas received for SHIPPER'S account by COMPANY fail to conform to any of the specifications provided for in this Section 3 when tendered for receipt into COMPANY'S system, COMPANY shall notify SHIPPER of any such failure and may at its option suspend all or a portion of the receipt of any such gas, and COMPANY shall be relieved of any of its applicable obligations for the duration of such time as the gas does not meet such specifications.  At SHIPPER's request in writing following such notice, COMPANY shall take measures reasonably available to it to mitigate the non-conformance, and SHIPPER shall indemnify COMPANY for reasonable and verifiable costs and liabilities of nonconformance and mitigation.  If COMPANY proceeds, without SHIPPER'S written request, to continue to accept non-conforming gas, SHIPPER shall not be responsible for any damages. 

(b) 	Should any gas delivered by COMPANY to SHIPPER fail at any time to conform to the requirements of this Section 3, SHIPPER shall notify COMPANY of any such failure, and SHIPPER, unless gas received for its account is non-conforming or contributing to non-conformance, shall be relieved of any of its applicable obligations for the duration of such time as the gas does not meet such specifications.  COMPANY shall indemnify SHIPPER for reasonable and verifiable costs SHIPPER incurs due to the nonconformance.

SECTION 4.31

DISCOUNT TERMS


31.1 	If COMPANY agrees to discount its rate to SHIPPER below COMPANY's maximum rate under COMPANY's Rate Schedules FTS, ITS or PAL, the following discount terms may be reflected on the designated discount exhibit to the Service Agreement and will apply without the discount constituting a material deviation from COMPANY's pro forma Service Agreement; provided, however, any such discount shall not be granted in an unduly discriminatory manner and shall not be less than COMPANY's minimum rate.  Such discounted rate may:

(i)	apply only to specified quantities under SHIPPER'S Service Agreement(s);

(ii)	apply only if specified quantities are achieved (with maximum rates applicable to quantities above specified quantities or to all quantities if specified quantities are never achieved);

(iii)	apply only in a specified relationship to quantities actually transported (i.e., that the rates shall be adjusted in a specified relationship to the quantities actually transported);

(iv)	apply only during specified periods of the year or over specifically-defined periods of time;

(v)	apply only to specified Receipt or Delivery Points, markets, or other defined geographical areas;

(vi)	apply to quantities conditioned upon implementation and completion of a construction project or acquisition of facilities; and/or

(vii)	provide for an agreed upon overall rate, with a provision for adjusting the rate components of discounted agreements, if needed to preserve the agreed upon overall effective rate, so long as all rate components remain within the applicable minimum and maximum rates specified in the tariff.  Such discounted rate may be based on published index price point differentials or arrived at by formula provided that (a) the same rate design underlying the pipeline's tariff rates is utilized, (b) the rate component (i.e., reservation charge, usage charge, or both) that is discounted is identified, and (c) to the extent the reservation charge is discounted, any formula used will produce a reservation rate per unit of contract demand.

31.2	Nothing contained herein shall entitle a SHIPPER to capacity or a discount at points or along segments other than those for which the original discount has been explicitly granted.  If a SHIPPER does not retain its discount or the discount at the alternate Receipt Point or Delivery Point is higher than SHIPPER'S discount, the Reservation Charge billed to SHIPPER under SHIPPER'S Service Agreement shall be prorated based on the total actual quantities allocated to the alternate Receipt or Delivery Point.


31.3	A SHIPPER may request to extend its discount for service at other points by submitting a request to COMPANY's Marketing Department in writing on the form provide by COMPANY no less than two (2) hours prior to the nomination deadline in which it plans to nominate use of the alternate point(s).  COMPANY shall respond to all valid requests received between 7:00 a.m. and 4:00 p.m. CCT on COMPANY's Business Day and inform SHIPPER within two (2) hours of receipt of the request whether the discount may be retained; provided, however, that COMPANY shall have until 8:30 a.m. CCT on the subsequent Business Day to respond to any such requests received by it after 4:00 p.m. and prior to 7:00 a.m. CCT on Business Days or received at any time on non-Business Days.
